import Card from "../Card/Card"
import "./CardsGrid.css"
const CardsGrid = () => {
    const personajes = [
        {
            id: 1,
            name: "Anakin",
            img: "ankin.jpg",
            descricion: ""
        },
        {
            id: 2,
            name: "Ahsoka",
            img: "ahsoka.jpg",
            descricion: ""
        },
        {
            id: 3,
            name: "Batman",
            img: "batman.jpg",
            descricion: ""
        }
    ]
    return(
        <section className="card-container">
            {personaje.map((personaje)=>
                <Card name={personajes.name} descricion={personajes.descricion} img={personajes.img} id={personajes.id} />
            )}
        </section>
    )        
}
export default CardsGrid
